import React from 'react'


function Footer(props) {
  return (
    <footer class="Footer">
      <div id="contact-me" class="contact">
        <p><a>rrvallar@gmail.com</a></p>
        <p><a>GitHub</a></p>
        <p><a>555.555.555</a></p>
      </div>
    </footer>
  )};

export default Footer;
